import React, { useState } from "react";
import { Link, NavLink } from "react-router-dom";

export default function Navbar() {
  const navStyle = {
    color: "#444342",
    listStyle: "none",
  };
  return (
    <div>
      <nav
        className="navbar"
        style={{
          listStyle: "none",
          display: "inline-block",
          display: "flex",
          justifyContent: "space-between",
        }}
      >
        <Link
          className="title"
          to="/"
          activeClassName="main-nav-active"
          style={navStyle}
        >
          Go Travel
        </Link>
        <div className="menuContain" style={navbar}>
          <ul className="menuContain">
            <li className="logIn">
              <NavLink
                to="/Login"
                className="menuitems"
                activeClassName="main-nav-active"
                style={navStyle}
              >
                Log-In
              </NavLink>
            </li>
            <li className="myList">
              <NavLink
                to="/#"
                className="menuitems"
                activeClassName="main-nav-active"
              >
                {" "}
                My List
              </NavLink>
            </li>
            <li className="posting">
              <NavLink
                to="/Gallery"
                className="menuitems"
                activeClassName="main-nav-active"
              >
                {" "}
                Post My Tri
              </NavLink>
            </li>
            <li className="singIn">
              <NavLink
                to="/Joinus"
                className="menuitems"
                activeClassName="main-nav-active"
                activeStyle
              >
                {" "}
                Sing-In
              </NavLink>
            </li>
          </ul>
        </div>
        <div></div>

        <i className="fas fa-search"></i>
      </nav>
    </div>
  );
}

